/* ------ JavaScript - Image Manipulation Pixel Fire ------ */
const myImage = new Image();
myImage.src =
  "data:image/jpeg;base64, ";

myImage.addEventListener("load", function () {
  const canvas = document.getElementById("canvas1");
  const ctx = canvas.getContext("2d");
  canvas.width = 398;
  canvas.height = 440;
  /**/
  const gradient1 = ctx.createLinearGradient(0, 0, canvas.width, canvas.height); // Rainbow gradient.
  gradient1.addColorStop("0.2", "pink");
  gradient1.addColorStop("0.3", "red");
  gradient1.addColorStop("0.4", "orange");
  gradient1.addColorStop("0.5", "yellow");
  gradient1.addColorStop("0.6", "green");
  gradient1.addColorStop("0.7", "turquoise");
  gradient1.addColorStop("0.8", "violet");

  const letters = ["P", "W", "L"]; // To add P, W, L text to particles.
  let switcher = 1;
  let counter = 0;
  setInterval(function () {
    counter++;
    if (counter % 12 === 0) {
      switcher *= -1;
    }
  }, 500);

  ctx.drawImage(myImage, 0, 0, canvas.width, canvas.height);
  const pixels = ctx.getImageData(0, 0, canvas.width, canvas.height);
  ctx.clearRect(0, 0, canvas.width, canvas.height);

  let particlesArray = [];
  const numberOfParticles = 7000;

  let mappedImage = [];
  for (let y = 0; y < canvas.height; y++) {
    let row = [];
    for (let x = 0; x < canvas.width; x++) {
      const red = pixels.data[y * 4 * pixels.width + x * 4];
      const green = pixels.data[y * 4 * pixels.width + (x * 4 + 1)];
      const blue = pixels.data[y * 4 * pixels.width + (x * 4 + 2)];
      const brightness = calculateRelativeBrightness(red, green, blue);
      const cell = [
        (cellBrightness = brightness),
        (cellColor = "rgb(" + red + "," + green + "," + blue + ")"),
      ];
      row.push(cell);
    }
    mappedImage.push(row);
  }

  function calculateRelativeBrightness(red, green, blue) {
    return (
      Math.sqrt(
        red * red * 0.299 + green * green * 0.587 + blue * blue * 0.114
      ) / 100
    );
  }

  class Particle {
    constructor() {
      this.x = Math.random() * canvas.width;
      this.y = 0;
      this.speed = 0;
      this.velocity = Math.random() * 0.5;
      this.size = Math.random() * 1.05 + 1;
      this.position1 = Math.floor(this.y);
      this.position2 = Math.floor(this.x);
      this.angle = 0; // want particles to fluctuate at differing speeds depending on brightness of the image areas.
      this.letter = letters[Math.floor(Math.random() * letters.length)]; // randomise P,W,L text, in letters array.
      this.random = Math.random(); // Randomises between text particles and normal particle shapes, arc and Rect.
    }
    update() {
      this.position1 = Math.floor(this.y);
      this.position2 = Math.floor(this.x);
      if (
        mappedImage[this.position1] &&
        mappedImage[this.position1][this.position2]
      ) {
        this.speed = mappedImage[this.position1][this.position2][0]; // cell brightness index 0
      }
      let movement = 2.5 - this.speed + this.velocity;
      this.angle += this.speed / 20; // adjust the speed of particle angle by dividing it smaller.
      this.size = this.speed * 1.5; // adjusts the size of particles by their speed.
      //   ctx.globalCompositeOperaton = "soft-light"; // other properties are; luminosity, lighter
      /*
      if (switcher === 1) {
        ctx.globalCompositeOperaton = "luminosity";
      } else {
        ctx.globalCompositeOperaton = "soft-light";
      }
      if (counter % 22 === 0) {
        this.x = Math.random() * canvas.width;
        this.y = 0;
      }
      */
      this.y -= movement; // movement*2; - & create waves of circular movement.
      this.x += movement + Math.sin(this.angle) * 2; // movement/2; - affects direction of particles.
      if (this.y <= 0) {
        this.y = canvas.height;
        this.x = Math.random() * canvas.width;
      }
      if (this.x >= canvas.width) {
        this.x = 0;
        this.y = Math.random() * canvas.height;
      }
    }
    draw() {
      ctx.beginPath();

      if (
        mappedImage[this.position1] &&
        mappedImage[this.position1][this.position2]
      ) {
        ctx.fillStyle = mappedImage[this.position1][this.position2][1]; // cell colour index 1 applied to ctx.arc.
        ctx.strokeStyle = mappedImage[this.position1][this.position2][1]; // adding image color to ctx.strokeRect.
      }

      //ctx.fillStyle = gradient1; // dissable this and enable mappedImage if statement above to show origional image colors.
      //ctx.strokeRect(this.x, this.y, this.size * 3, this.size * 3); // dissable ctx.arc and enable this to draw rectangular shapes, remove multiply for more detail.
      ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);

      ctx.fill();
    }
  }
  function init() {
    for (let i = 0; i < numberOfParticles; i++) {
      particlesArray.push(new Particle());
    }
  }
  init();
  function animate() {
    ctx.globalAlpha = 0.03;
    ctx.fillStyle = "rgb(0, 0, 0)"; // Controls the colour of the image background
    ctx.fillRect(0, 0, canvas.width, canvas.height);

    for (let i = 0; i < particlesArray.length; i++) {
      particlesArray[i].update();
      //ctx.globalAlpha = particlesArray[i].speed * 0.95;
      ctx.globalAlpha = 1; // dissable ctx.globalAlpha above and enable this, to show full opacity.
      particlesArray[i].draw();
    }
    requestAnimationFrame(animate);
  }
  animate();
});
